import React from 'react';
import HeaderBlock from './components/HeaderBlock';
import TextBlock from './components/TextBlock';
import FooterBlock from './components/FooterBlock';
import ImageBlock from './components/ImageBlock';
import Card from './components/Card';

export const wordsList = [
  {
      eng: 'between',
      rus: 'между'
  },
  {
      eng: 'high',
      rus: 'высокий'
  },
  {
      eng: 'really',
      rus: 'действительно'
  },
  {
      eng: 'something',
      rus: 'что-нибудь'
  },
  {
      eng: 'most',
      rus: 'большинство'
  },
  {
      eng: 'another',
      rus: 'другой'
  },
  {
      eng: 'much',
      rus: 'много'
  },
  {
      eng: 'family',
      rus: 'семья'
  },
  {
      eng: 'own',
      rus: 'личный'
  },
  {
      eng: 'out',
      rus: 'из/вне'
  },
  {
      eng: 'leave',
      rus: 'покидать'
  },
];


const App = () => {
  return (
      <>
        <HeaderBlock 
          title="World Travel Guide"
          descr="Live Your Life"
        >
          <button>Get my Trip</button>

        </HeaderBlock>

        <TextBlock />

        <ImageBlock />
        <FooterBlock />
      </>
  );
}
export default App;
